import { useNavigate } from "react-router-dom";

function Landing() {
  const navigate = useNavigate();

  const handleClick = () => {
    navigate("home");
  };

  return (
    <div>
      <button onClick={handleClick}>Explore</button>
    </div>
  );
}

export default Landing;
